INSERT INTO sdm_sql_management (id, code, description, sql_sentence, resource_id, tenant_id, system_id, create_time, update_time, resource_type) VALUES ('1140380217622134784', 'powerDispatchExport', '发电调度导出', 'SELECT 
f.id,
city.precinct_name AS cityId,
area.precinct_name AS areaId,
site.precinct_name AS siteId,
room.precinct_name AS roomId,
rt.dict_note AS roomType,
(CASE WHEN f.room_level=\'1\' THEN \'地市\'
WHEN f.room_level=\'2\' THEN \'省中心\'
ELSE \'\' END
 )AS roomLevel,
 (CASE WHEN f.handed_over_to_tower_maintenance=\'1\' THEN \'是\'
 WHEN f.handed_over_to_tower_maintenance=\'0\' THEN \'否\'
ELSE \'\' END
 )
 AS handedOverToTowerMaintenance,
 f.power_generation_group AS powerGenerationGroup,
 f.travel_time_hours AS travelTimeHours,
 f.on_site_generator_info AS onSiteGeneratorInfo,
 f.required_generators AS requiredGenerators,
 f.remark AS remark
FROM 
t_zypt_power_dispatch f
LEFT JOIN t_cfg_precinct city ON f.city_id=city.precinct_id
LEFT JOIN t_cfg_precinct `area` ON f.area_id=area.precinct_id
LEFT JOIN t_cfg_precinct site ON f.site_id=site.precinct_id
LEFT JOIN t_cfg_precinct room ON f.room_id=room.precinct_id
LEFT JOIN t_cfg_dict rt ON f.room_type=rt.dict_code AND rt.col_name=\'room_kind\'
where true
<if test="cityId !=null and cityId !=\'\'">
    and f.city_id =#{cityId}
</if>
<if test="areaId !=null and areaId !=\'\'">
    and f.area_id =#{areaId}
</if>
<if test="siteId !=null and siteId !=\'\'">
    and f.site_id =#{siteId}
</if>
<if test="roomId !=null and roomId !=\'\'">
    and f.room_id =#{roomId}
</if>
<if test="roomType !=null and roomType !=\'\'">
    and f.room_type =#{roomType}
</if>
<if test="roomLevel !=null and roomLevel !=\'\'">
    and f.room_level=#{roomLevel}
</if>
<if test="handedOverToTowerMaintenance !=null and handedOverToTowerMaintenance !=\'\'">
    and f.handed_over_to_tower_maintenance=#{handedOverToTowerMaintenance}
</if>', '1139995624561704960', '1', '1021102703058616320', '2025-07-09 17:43:23.000', '2025-07-11 11:02:27.000', 'D');
INSERT INTO sdm_sql_management (id, code, description, sql_sentence, resource_id, tenant_id, system_id, create_time, update_time, resource_type) VALUES ('1141112566089515008', 'findFenceAlert', '围栏监控查询', 'SELECT 
id,
create_date AS createDate,
city_id AS cityId,
area_id AS areaId,
site_id AS siteId,
monitoring_location AS monitoringLocation,
event_description AS eventDescription,
remarks,
null as endDate
FROM t_zypt_fence_alert
where create_date BETWEEN #{createDate} AND #{endDate} 
<if test="cityId !=null and cityId !=\'\'">
 and city_id =#{cityId}
</if>
<if test="areaId !=null and areaId !=\'\'">
 and area_id =#{areaId}
</if>
<if test="siteId !=null and siteId !=\'\'">
 and site_id =#{siteId}
</if>
<if test="monitoringLocation !=null and monitoringLocation !=\'\'">
 and monitoring_location =#{monitoringLocation}
</if>', '1139995624561704960', '1', '1021102703058616320', '2025-07-11 18:13:45.000', '2025-07-11 19:01:33.000', 'D');
